import React from "react";
import { Calendario } from "./style";

function Card(dias: any) {
  console.log(dias.dias.domingo);
  let domingo=[];
  for (let i = 0; i < dias.dias.domingo.length; i++) {
    let element = dias.dias.domingo[i];
    domingo[i] = <li>{element}</li>
  }
  return (
    <>
      <Calendario>
        {domingo}
      </Calendario>
    </>
  );


}

export default Card;
